import React from 'react'
import Login from './Pages/Login.js'
import {
  BrowserRouter as Router,
  Route,
  Routes
} from "react-router-dom";


function App() {
  return (<>
  <BrowserRouter>
    <Routes>
      <Route />
    </Routes>
  </BrowserRouter>
  <Login />
  </>);
}

export default App;
